import './App.css';
import React from 'react';
import Header from './header'
import Hotmap from './heat-map'
import ShipSelector from './ship-selector'

class App extends React.Component {
  render() {
    return (
      <div className="background">
        <Header/>
        <h1 className = 'h1'>An activity heatmap for PVE ship losses in wormhole space.</h1>
        <Hotmap/>
        <ShipSelector/>
      </div>
    )
  }
}
export default App;
